import React, { Component } from 'react';
import Script, { handleScriptCreate} from 'react-load-script'

handleScriptCreate(); {
    this.setState({ scriptLoaded: false })
  }

  handleScriptError(); {
    this.setState({ scriptError: true })
  }

  handleScriptLoad(); {
    this.setState({ scriptLoaded: true })
  }

class NewsPage extends Component {
    constructor(props){
        super(props)
    }
    render() {   
        return(
            <div>
                <div>xxxx</div>
                <Script
                src="https://cointelegraph.com/news-widget" data-ct-widget-limit="35" data-ct-widget-theme="light" data-ct-widget-size="medium" data-ct-widget-images="true" data-ct-widget-language="en"
      onCreate={this.handleScriptCreate.bind(this)}
      onError={this.handleScriptError.bind(this)}
      onLoad={this.handleScriptLoad.bind(this)}
    />
                <div>
                <script src="https://cointelegraph.com/news-widget" data-ct-widget-limit="35" data-ct-widget-theme="light" data-ct-widget-size="medium" data-ct-widget-images="true" data-ct-widget-language="en"></script>
                </div>
            </div>
        )
    }
}

export default NewsPage

